import React from "react";
import {Row,Col} from "reactstrap";
export default class Splash extends React.Component {
  constructor(props) {
    super(props);
  }
  render() {
    return (
      <section className="splash">
        <Row>

        </Row>
        <img className="splash-1 d-inline" src="/static/images/splash-1.jpg" />
        <img className="splash-2 d-inline" src="/static/images/splash-2.jpg" />
        <button className="button-1">&lt;</button>
        <button className="button-2">&gt;</button>
      </section>
    );
  }
}
